.switch-container {
  display: inline-block;
  cursor: pointer !important;
  color: #666;
}
.switch-container:hover {
  color: #404040 !important;
}
.switch-container .switch {
  position: relative;
  display: inline-block !important;
  width: 40px;
  height: 20px;
  vertical-align: middle;
  margin-right: 5px;
}
.switch-container .switch .slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: #fff;
  border: 1px solid #999;
  transition: 0.4s;
  border-radius: 20px;
}
.switch-container .switch .slider:before {
  position: absolute;
  content: "";
  height: 10px;
  width: 10px;
  left: 4px;
  bottom: 4px;
  background-color: #999;
  transition: 0.4s;
  border-radius: 50%;
}
.switch-container .switch .slider:hover {
  border-color: #737373;
}
.switch-container .switch .slider:hover:before {
  border-color: #737373;
}
.switch-container .switch input {
  display: none;
}
.switch-container .switch input:checked + .slider {
  background-color: #117865;
  border-color: #117865;
}
.switch-container .switch input:checked + .slider:before {
  background-color: #fff;
  transform: translateX(19px);
}
.switch-container .switch input:focus + .slider {
  box-shadow: 0 0 1px #117865;
}
.switch-container .switch input[disabled] + .slider {
  border-color: #d3d3d3;
  background-color: #d3d3d3;
  cursor: not-allowed;
}
.switch-container .switch input[disabled] + .slider:before {
  background-color: #fff;
}
.switch-container .switch.partial .slider {
  background-color: #b0c2bf !important;
  border-color: #b0c2bf !important;
}
.switch-container .switch.partial .slider:before {
  transform: translateX(9.5px) !important;
  background-color: #fff !important;
}
.switch-container .label {
  margin-left: 2px;
}
.switch-container.small .switch {
  width: 24px;
  height: 13px;
  margin-right: 5px;
}
.switch-container.small .switch .slider {
  border-radius: 10px;
}
.switch-container.small .switch .slider:before {
  height: 8px;
  width: 8px;
  left: 1.5px;
  bottom: 1.5px;
}
.switch-container.small .switch input:checked + .slider:before {
  transform: translateX(11px);
}
.switch-container.small .switch.partial .slider:before {
  transform: translateX(5.5px) !important;
}
